import React, { useEffect } from "react";
import MoreVertIcon from "@material-ui/icons/MoreVert";
import { Grid, Switch, Box } from "@material-ui/core";
import * as CSS from "csstype";

interface IOption {
  darkmode: boolean;
  setDarkmode: (darkmodex: boolean) => void;
  marginData: CSS.Properties;
  fontData: CSS.Properties;
  switchsize: "medium" | "small" | undefined;
}

export default function Option({
  darkmode,
  setDarkmode,
  marginData,
  fontData,
  switchsize,
}: IOption): JSX.Element {
  return (
    <Grid container xs={12}>
      <Grid
        item
        xs={12}
        style={{ textAlign: "right", backgroundColor: "#00ccff" }}
      >
        <MoreVertIcon fontSize="large" className="ss" />
      </Grid>
    </Grid>
  );
}
